INSERT INTO `gift_info` VALUES ('194', '4', '九阳电炖锅', 'http://alioss.qileah.cn/GiftExchange/GiftPicture/DomesticAppliance/JoyoungDDG.png', '22680', '一锅四胆，充足大容量1.8L(约5小碗），24小时智能预约，隔水电炖锅', '1', null, null, '1');
