INSERT INTO `gift_info` VALUES ('197', '4', '美的多功能电烤箱', 'http://alioss.qileah.cn/GiftExchange/GiftPicture/DomesticAppliance/MideaMutilDKX.png', '10680', '一键烘焙，双感温探头，9H发酵可调，钻面型烤腔', '1', null, null, '1');
