INSERT INTO `gift_info` VALUES ('204', '1', '爱奇艺', 'http://alioss.qileah.cn/GiftExchange/GiftPicture/FilmVip/Iqiyi.png', '2400', '院线新片，海量高分大片，热剧抢先看，不用看广告，多达20多项会员特权', '1', null, null, '1');
