INSERT INTO `msg_content` VALUES ('1', 'U', '1', '2018-09-20 14:35:58', '2018-09-20 00:00:00', '2019-01-01 00:00:00', '七乐安徽麻将正式上线运营', '亲爱的玩家们：\n   您们好！七乐安徽麻将经过不断的完善，已正式上线啦。诚邀各位新老玩家前来体验，提出宝贵意见。\n\n新品七乐安徽麻将有以下特色：\n1、动态背景，画面精美\n2、升级3D麻将，更稳定，更流畅，更好玩\n3、打比赛、做任务、拉好友，各种任务活动，丰富奖品等你来拿\n4、多种牌种，娱乐场，比赛场，好友开房，玩法多样\n5、加入代理，超高收益，还有更多福利等你来拿。\n\n文明游戏，禁止赌博。\n七乐祝您一周七天棋牌游戏乐不停！\n\n        七乐运营团队');
INSERT INTO `msg_content` VALUES ('2', 'U', '0', '2018-09-27 18:56:48', '2018-09-27 00:00:00', '2018-09-30 00:00:00', '霍邱麻将正式上线公测', '\n亲爱的玩家，大家好；\n\n 今日霍邱麻将3D版正式上线公测，诚邀广大霍邱玩家前来体验，并向我们提出宝贵建议；\n\n 霍邱麻将特色如下\n 1、3D炫彩桌面，牌面清晰、出牌快速。\n 2、默认杠后花、天胡地胡、抢杠胡、一炮多响的刺激玩法\n3、选项丰富，针对不同人群制定个性化打法。\n4、同IP自动检测、GPS高强定位。\n\n感谢您对七乐的支持，\n请文明游戏，禁止赌博\n \n                                                七乐运营团队');
INSERT INTO `msg_content` VALUES ('3', 'U', '0', '2018-09-27 18:56:48', '2018-09-27 00:00:00', '2018-09-30 00:00:00', '霍邱麻将正式上线公测', '\n亲爱的玩家，大家好；\n\n     今日霍邱麻将3D版正式上线公测，诚邀广大霍邱玩家前来体验，并向我们提出宝贵建议；\n\n  霍邱麻将特色如下\n 1、3D炫彩桌面，牌面清晰、出牌快速。\n 2、默认杠后花、天胡地胡、抢杠胡、一炮多响的刺激玩法\n3、选项丰富，针对不同人群制定个性化打法。\n4、同IP自动检测、GPS高强定位。\n');
INSERT INTO `msg_content` VALUES ('4', 'U', '0', '2018-10-10 11:23:08', '2018-10-10 00:00:00', '2018-10-20 00:00:00', 'V1.1.1.2更新通知', 'V1.1.1.2更新通知\n \n      更新时间为10月10号早8点至8点30分，本次更新内容如下：\n\n    1：麻将增加踢人功能\n    2：增加圈主解散房间功能\n    3：优化一炮多响时庄次的问题\n    4：优化战绩详情的头像错位问题\n    5：优化吃碰牌时出现的问题\n    6：修复一条龙未算分的问题\n    7：商城充钻赠送改为钻石（原为七豆）\n    8：调整比鸡全红全黒的喜分倍数\n    9：增加三顺子喜分的选项\n  10：优化连顺喜分\n  11：修复部份机型无法复制分数\n  12：优化若干细节\n\n  文明游戏，禁止赌博\n                  \n                                                                         七乐运营团队\n\n');
INSERT INTO `msg_content` VALUES ('5', 'U', '0', '2018-10-10 11:25:15', '2018-09-27 00:00:00', '2018-09-30 00:00:00', '霍邱麻将正式上线公测', '\n亲爱的玩家，大家好；\n\n 今日霍邱麻将3D版正式上线公测，诚邀广大霍邱玩家前来体验，并向我们提出宝贵建议；\n\n 霍邱麻将特色如下\n 1、3D炫彩桌面，牌面清晰、出牌快速。\n 2、默认杠后花、天胡地胡、抢杠胡、一炮多响的刺激玩法\n3、选项丰富，针对不同人群制定个性化打法。\n4、同IP自动检测、GPS高强定位。\n\n感谢您对七乐的支持，\n请文明游戏，禁止赌博\n \n                                                七乐运营团队');
INSERT INTO `msg_content` VALUES ('6', 'U', '0', '2018-10-15 10:59:53', '2018-10-10 00:00:00', '2018-10-20 00:00:00', 'V1.1.1.2更新通知', 'V1.1.1.2更新通知\n      更新时间为10月10号早8点至8点30分，本次更新内容如下：\n\n    1：麻将增加踢人功能\n    2：增加圈主解散房间功能\n    3：优化一炮多响时庄次的问题\n    4：优化战绩详情的头像错位问题\n    5：优化吃碰牌时出现的问题\n    6：修复一条龙未算分的问题\n    7：商城充钻赠送改为钻石（原为七豆）\n    8：调整比鸡全红全黒的喜分倍数\n    9：增加三顺子喜分的选项\n  10：优化连顺喜分\n  11：修复部份机型无法复制分数\n  12：优化若干细节\n\n  文明游戏，禁止赌博\n                  \n                                                                         七乐运营团队\n\n');
