INSERT INTO `msg_content_user` VALUES ('180', '1', '210539', '2018-11-30 10:31:08', '亲爱的玩家们：\n   您们好！七乐安徽麻将经过不断的完善，已正式上线啦。诚邀各位新老玩家前来体验，提出宝贵意见。\n\n新品七乐安徽麻将有以下特色：\n1、动态背景，画面精美\n2、升级3D麻将，更稳定，更流畅，更好玩\n3、打比赛、做任务、拉好友，各种任务活动，丰富奖品等你来拿\n4、多种牌种，娱乐场，比赛场，好友开房，玩法多样\n5、加入代理，超高收益，还有更多福利等你来拿。\n\n文明游戏，禁止赌博。\n七乐祝您一周七天棋牌游戏乐不停！\n\n        七乐运营团队', '七乐安徽麻将正式上线运营', '2018-11-30 10:31:10', '1');
