-- ----------------------------
-- Procedure structure for `GS_FrozenUserAccount`
-- ----------------------------
DROP PROCEDURE IF EXISTS `GS_FrozenUserAccount`;
DELIMITER ;;
CREATE DEFINER=`qiledb`@`%` PROCEDURE `GS_FrozenUserAccount`(IN in_objectId int,
                                                IN in_objectType int,
                                                IN in_moneyType int,
                                                IN in_moneyNum int,
                                                IN in_tableId int,
                                                IN in_rommId  int,
                                                IN in_mark varchar(200),
                                                OUT o_orderId varchar(50),
                                                OUT returnvalue int)
lable:BEGIN
  DECLARE v_userid int;
  DECLARE v_rmb double(10,2);
  DECLARE v_diamond double(10,2);
  DECLARE v_gold double(10,2);
  DECLARE v_friendid int;
  DECLARE v_agentid int;
  DECLARE v_freezeid varchar(50);
  /* 用户或亲友圈冻结记录
 输入：  in_objectId	int	 指定此次预扣的账户Id
         in_objectType	int	 指定账户类型 1：玩家 2：圈主 3：代理
         in_moneyType	int	 指定冻结的道具类型 使用通用的moneyType 枚举定义 0无1RMB2钻石3金币
         in_moneyNum	int	 冻结账户内余额的数量
         in_tableId  int  桌号
         in_roomId   int  房间号
         in_mark	string	结算备注
 输出: o_orderId	int	本次冻结的订单Id
       returnvalue 操作结果 1：暂扣成功 -1：暂扣失败*/
  SET @@autocommit=off;
	set o_orderId = '';
  SET returnvalue=-1;
  /*验证冻结资金*/
  IF in_objectType=1 THEN
     SET v_userid=in_objectId;
    ELSEIF in_objectType=2 THEN
     SELECT fi.userid INTO v_userid FROM friend_info fi WHERE fi.friendid=in_objectId;
     SET v_friendid=in_objectId;
    ELSEIF in_objectType=3 THEN
     SELECT ai.userid INTO v_userid FROM agent_info ai WHERE ai.agentid=in_objectId;
     SET v_agentid=in_objectId;
  END IF;
  --
   SELECT ua.rmb,ua.diamond,ua.gold INTO v_rmb,v_diamond,v_gold
     FROM user_account ua WHERE ua.userid=v_userid;
  /*保存冻结记录*/
   IF in_moneyType= 0 THEN
      SET returnvalue=1;
      LEAVE lable;
     ELSEIF in_moneyType= 1 THEN
       IF in_moneyNum<= v_rmb THEN
         SET v_freezeid=CONCAT(fc_nextval('log_user_freeze'),'');
           VALUES(v_freezeid,v_userid,v_friendid,v_agentid,in_rommId,in_tableId,'RM',in_moneyNum,SYSDATE(),'0',in_mark);
         CALL sp_log_fund_user(v_freezeid,v_userid,-in_moneyNum,'RM','26');
         SET o_orderId=v_freezeid;
         SET returnvalue=1;
        ELSE
          SET returnvalue=-1;
          LEAVE lable;
        END IF;
     ELSEIF in_moneyType= 2 THEN
       IF in_moneyNum<= v_diamond THEN
         SET v_freezeid=CONCAT(fc_nextval('log_user_freeze'),'');
           VALUES(v_freezeid,v_userid,v_friendid,v_agentid,in_rommId,in_tableId,'VD',in_moneyNum,SYSDATE(),'0',in_mark);
         CALL sp_log_fund_user(v_freezeid,v_userid,-in_moneyNum,'VD','26');
         SET o_orderId=v_freezeid;
         SET returnvalue=1;
        ELSE
          SET returnvalue=-1;
          LEAVE lable;
        END IF;
     ELSEIF in_moneyType= 3 THEN
       IF in_moneyNum<= v_gold THEN
         SET v_freezeid=CONCAT(fc_nextval('log_user_freeze'),'');
           VALUES(v_freezeid,v_userid,v_friendid,v_agentid,in_rommId,in_tableId,'VG',in_moneyNum,SYSDATE(),'0',in_mark);
         CALL sp_log_fund_user(v_freezeid,v_userid,-in_moneyNum,'VG','26');
         SET o_orderId=v_freezeid;
         SET returnvalue=1;
        ELSE
          SET returnvalue=-1;
          LEAVE lable;
        END IF;
   END IF;  
  COMMIT;                      
  SELECT v_userid as UserId, 1 AS MoneyType ,ua.rmb AS MoneyNum ,ua.userid UserId FROM user_account ua WHERE ua.userid=v_userid
  UNION ALL
  SELECT v_userid as UserId, 2 AS MoneyType ,ua.diamond AS MoneyNum ,ua.userid UserId FROM user_account ua WHERE ua.userid=v_userid
  UNION ALL
  SELECT v_userid as UserId, 3 AS MoneyType ,ua.gold AS MoneyNum ,ua.userid UserId FROM user_account ua WHERE ua.userid=v_userid
  UNION ALL
  SELECT v_userid as UserId, 4 AS MoneyType ,ua.qidou AS MoneyNum ,ua.userid UserId FROM user_account ua WHERE ua.userid=v_userid;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `GS_PlayerSettlementMultiple`
-- ----------------------------
DROP PROCEDURE IF EXISTS `GS_PlayerSettlementMultiple`;
DELIMITER ;;
CREATE DEFINER=`qiledb`@`%` PROCEDURE `GS_PlayerSettlementMultiple`(IN in_RoomId int, 
                                                       IN in_GameId int, 
                                                       IN in_RoomCostType int, 
                                                       IN in_RoomCost int, 
                                                       IN in_OwnerId int, 
                                                       IN in_GroupId int, 
                                                       IN in_RoomCostMoneyType int, 
                                                       IN in_mark varchar(1000),
                                                       IN in_MoneyType int, 
                                                       IN in_FeeUserCount int, 
                                                       IN in_UserId varchar(500), 
                                                       IN in_MoneyNum varchar(500), 
                                                       IN in_GameNum int, 
                                                       IN in_tableid int,
                                                       IN in_totalnum int,
                                                       IN in_mid varchar(100),
                                                       IN in_friendgameid int,
                                                       OUT returnvalue int)
BEGIN
 DECLARE v_setid int ;
  DECLARE v_i int DEFAULT 0;
  DECLARE v_in_userid int DEFAULT 0;
  DECLARE v_in_moneynum int DEFAULT 0;
  DECLARE v_group_userid int DEFAULT 0;
  DECLARE v_is_owner int DEFAULT 0;
  DECLARE v_is_group int DEFAULT 0;
  DECLARE v_o_roomcost int DEFAULT 0;
  DECLARE v_realmoney int DEFAULT 0;
  DECLARE v_in_iswiner int DEFAULT 0;
  DECLARE v_max_str varchar(500);
  DECLARE v_sql1 varchar(2000) DEFAULT ' ';
  DECLARE v_sql2 varchar(2000) DEFAULT ' ';
  set @@autocommit=off;
  SET returnvalue=0;
  SET v_setid=fc_nextval('order_settlement');
  /* order_settlement*/
       VALUES(v_setid, in_roomid, in_gameid, in_RoomCostType, in_RoomCost, in_ownerid, in_groupid, in_RoomCostMoneyType, in_mark, in_MoneyType, in_FeeUserCount, SYSDATE(),in_GameNum,in_tableid,in_totalnum,in_mid,in_friendgameid
  );
  /*如果是圈主支付 取圈主ID*/
  IF in_RoomCostType=3 THEN
    SELECT fi.userid INTO v_group_userid FROM friend_info fi WHERE fi.friendid=in_GroupId;
  END IF;
  /*--order_recorddata_detail*/
  SET v_max_str=fc_order_str(in_MoneyNum);
  SET v_i=0;
  loop_label:loop
      SET v_i=v_i+1;
      SET v_in_userid=fc_split_str(in_UserId,';',v_i)+0;
      SET v_in_moneynum=fc_split_str(in_MoneyNum,';',v_i)+0;
      SET v_in_iswiner=fc_split_str(v_max_str,';',v_i)+0;
      IF ISNULL(v_in_userid) THEN
           leave loop_label;
      END IF;
              VALUES(v_setid,v_in_userid,v_in_moneynum,SYSDATE(),v_in_iswiner);
			
			
      /* 每日游戏10,20,35局 任务*/
			/*IF (in_totalnum >= 8) THEN
				CALL WEB_TaskPut(v_in_userid,'PUTGame10',1,@p_out);
				CALL WEB_TaskPut(v_in_userid,'PUTGame20',1,@p_out);
				CALL WEB_TaskPut(v_in_userid,'PUTGame35',1,@p_out);
			END IF;*/
			
			/* 每日任意麻将游戏次数 5,10,20 任务 */
			/*IF (in_GameId >= '100' AND in_totalnum >= 8 AND v_in_moneynum > 0) THEN
				CALL WEB_TaskPut(v_in_userid,'PUTMJWin5',1,@p_out);
				CALL WEB_TaskPut(v_in_userid,'PUTMJWin10',1,@p_out);
				CALL WEB_TaskPut(v_in_userid,'PUTMJWin20',1,@p_out);
			END IF;*/

  /*结算房费1AA2房主3圈主*/
  /*结算房费类型0无1RMB2钻石3金币*/
    IF in_RoomCostType=1 THEN
      CALL GS_SettlementOne(v_setid,'20',v_in_userid,in_RoomCostMoneyType,-in_RoomCost,v_o_roomcost);
    END IF;
  /*玩家结算类型0无1RMB2钻石3金币*/
    CALL GS_SettlementOne(v_setid,'21',v_in_userid,in_MoneyType,v_in_moneynum,v_realmoney);
  /*结算后返回*/
    /*SET o_UserID=CONCAT(CAST(v_in_userid AS CHAR),';');
    SET o_MoneyNum=CONCAT(CAST(v_in_moneynum AS CHAR),';');
    SET o_RealFeeMoneyNum=CONCAT(CAST(v_in_moneynum AS CHAR),';');*/
    SET v_sql1 = CONCAT_WS(' ',v_sql1,'UNION ALL SELECT ','1 as AuditResult,' 
                                               , v_in_moneynum,' as MoneyNum,'
                                               , v_in_userid,' as UserID,'
                                               , v_realmoney,' as RealFeeMoneyNum ' );
  /*是否玩家有owner*/
     IF in_OwnerId=v_in_userid THEN
        SET v_is_owner=1;
     END IF;
   /*是否玩家有group*/
     IF v_group_userid=v_in_userid THEN
        SET v_is_group=1;
     END IF;
  end loop;
  /*更新大玩家*/
  /* UPDATE order_settlement_detail osd
      SET osd.iswiner=1
   WHERE osd.id IN (
                    SELECT aa.id
                     FROM ( SELECT osd.id,osd.moneynum,CASE WHEN @p=osd.moneynum THEN @r ELSE @r:=@r+1 END rank,@p:=osd.moneynum
                              FROM order_settlement_detail osd,(SELECT @r:=0,@p:=NULL)r
                              WHERE osd.setid=v_setid
                                AND osd.moneynum>0
                             ORDER BY osd.moneynum DESC) aa
                     WHERE aa.rank=1); */
  /*结算房费1AA2房主3圈主*/
  /*结算房费类型0无1RMB2钻石3金币*/
  IF in_RoomCostType=2 THEN
      CALL GS_SettlementOne(v_setid,'20',in_OwnerId,in_RoomCostMoneyType,-in_RoomCost*in_FeeUserCount,v_o_roomcost); 
  ELSEIF in_RoomCostType=3 THEN
      CALL GS_SettlementOne(v_setid,'20',v_group_userid,in_RoomCostMoneyType,-in_RoomCost*in_FeeUserCount,v_o_roomcost);
  END IF; 
  COMMIT;
 /*获取账户余额*/
   SET v_i=0;
  loop_label:loop
      SET v_i=v_i+1;
      SET v_in_userid=fc_split_str(in_UserId,';',v_i)+0;
      SET v_in_moneynum=fc_split_str(in_MoneyNum,';',v_i)+0;
      IF ISNULL(v_in_userid) THEN
           leave loop_label;
      END IF;
  /*结算房费1AA2房主3圈主*/
  /*结算房费类型0无1RMB2钻石3金币*/
  /*玩家结算类型0无1RMB2钻石3金币*/
   /*账户余额*/
   /* SET o_UserId2=CONCAT(CAST(v_in_userid AS CHAR),';');
    SET o_MoneyNum2=CONCAT(CAST(fc_get_user_account(v_in_userid,in_MoneyType) AS CHAR),';');
    SET o_MoneyType2=CONCAT(CAST(in_MoneyType AS CHAR),';');*/
    SET v_sql2 = CONCAT_WS(' ',v_sql2,'UNION ALL SELECT ', fc_get_user_account(v_in_userid,in_MoneyType),' as MoneyNum,'
                                               , v_in_userid,' as UserID,'
                                               , in_MoneyType,' as MoneyType ' );
    IF in_RoomCostMoneyType<>in_MoneyType AND in_RoomCostType=1  THEN
      SET v_sql2 = CONCAT_WS(' ',v_sql2,'UNION ALL SELECT ', fc_get_user_account(v_in_userid,in_RoomCostMoneyType),' as MoneyNum,'
                                               , v_in_userid,' as UserID,'
                                               , in_RoomCostMoneyType,' as MoneyType ' );
    END IF;
  end loop;
  IF in_RoomCostType=2 AND v_is_owner=0 THEN
      SET v_sql2 = CONCAT_WS(' ',v_sql2,'UNION ALL SELECT ', fc_get_user_account(in_OwnerId,in_RoomCostMoneyType),' as MoneyNum,'
                                               , in_OwnerId,' as UserID,'
                                               , in_RoomCostMoneyType,' as MoneyType ' );
  ELSEIF in_RoomCostType=3 AND v_is_group=0 THEN
      SET v_sql2 = CONCAT_WS(' ',v_sql2,'UNION ALL SELECT ', fc_get_user_account(v_group_userid,in_RoomCostMoneyType),' as MoneyNum,'
                                               , v_group_userid,' as UserID,'
                                               , in_RoomCostMoneyType,' as MoneyType ' );
  ELSEIF in_RoomCostMoneyType<>in_MoneyType AND in_RoomCostType=2 AND v_is_owner=1 THEN
      SET v_sql2 = CONCAT_WS(' ',v_sql2,'UNION ALL SELECT ', fc_get_user_account(in_OwnerId,in_RoomCostMoneyType),' as MoneyNum,'
                                               , in_OwnerId,' as UserID,'
                                               , in_RoomCostMoneyType,' as MoneyType ' );
  ELSEIF in_RoomCostMoneyType<>in_MoneyType AND in_RoomCostType=3 AND v_is_group=1 THEN
      SET v_sql2 = CONCAT_WS(' ',v_sql2,'UNION ALL SELECT ', fc_get_user_account(v_group_userid,in_RoomCostMoneyType),' as MoneyNum,'
                                               , v_group_userid,' as UserID,'
                                               , in_RoomCostMoneyType,' as MoneyType ' );
  END IF; 
  IF v_sql1<>' ' THEN
  SET v_sql1=substring(v_sql1, 13);
  SET @sql=v_sql1;
  PREPARE s1 from @sql;
  EXECUTE s1;
  DEALLOCATE PREPARE s1;
  END IF;
  IF v_sql2<>' ' THEN
  SET v_sql2=substring(v_sql2, 13);
  SET @sql=v_sql2;
  PREPARE s2 from @sql;
  EXECUTE s2;
  DEALLOCATE PREPARE s2;
  END IF;
  SET returnvalue=1;

END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `GS_SaveGameUserRecordData`
-- ----------------------------
DROP PROCEDURE IF EXISTS `GS_SaveGameUserRecordData`;
DELIMITER ;;
CREATE DEFINER=`qiledb`@`%` PROCEDURE `GS_SaveGameUserRecordData`(IN in_MId VARCHAR(100), IN in_SId VARCHAR(100), IN in_RoomId INT, IN in_GameId INT, IN in_RecPath VARCHAR(100), IN in_RecordType INT, IN in_OwnerId INT, IN in_GroupId INT, IN in_Mark VARCHAR(200), IN in_friendgameid INT, IN in_UserId VARCHAR(500), IN in_MoneyNum VARCHAR(500), IN in_MoneyType VARCHAR(100), IN in_tableid int, OUT returnvalue INT)
BEGIN
  DECLARE v_recordid int ;
  DECLARE v_i int DEFAULT 0;
  DECLARE v_userid int DEFAULT 0;
  DECLARE v_moneynum int DEFAULT 0;
  DECLARE v_moneytype int DEFAULT 0;
  set @@autocommit=off;
  SET returnvalue=-1;
  SELECT re.recordid INTO v_recordid
    FROM order_recorddata re 
    WHERE re.mid=in_MId and re.sid=in_SId;
  IF ISNULL(v_recordid) THEN
     SET v_recordid=fc_nextval('order_recorddata');
  /*--order_recorddata*/
                          VALUES(v_recordid,in_mid, in_sid, in_roomid, in_gameid, in_recordtype, in_ownerid, in_groupid, SYSDATE(), in_friendgameid,in_tableid);
  END IF;
  /*--order_recorddata_path*/
        VALUES(v_recordid, in_recpath, in_mark,SYSDATE());
  /*--order_recorddata_detail*/
  loop_label:loop
      SET v_i=v_i+1;
      SET v_userid=fc_split_str(in_UserId,';',v_i)+0;
      SET v_moneynum=fc_split_str(in_MoneyNum,';',v_i)+0;
      SET v_moneytype=fc_split_str(in_MoneyType,';',v_i)+0;
      IF ISNULL(v_userid) THEN
           leave loop_label;
      END IF;
              VALUES(v_recordid,v_userid,v_moneynum,v_moneytype,SYSDATE());
  end loop;
  COMMIT;
  SET returnvalue=1;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `GS_SettlementOne`
-- ----------------------------
DROP PROCEDURE IF EXISTS `GS_SettlementOne`;
DELIMITER ;;
CREATE DEFINER=`qiledb`@`%` PROCEDURE `GS_SettlementOne`(IN in_setid int, IN in_fundtype char(2), IN in_UserId int, IN in_MoneyType int, IN in_MoneyNum int, OUT o_MoneyNum int)
BEGIN
  DECLARE v_rmb double(12,2);
  DECLARE v_diamond double(12,2);
  DECLARE v_gold double(12,2);
  DECLARE v_qidou double(12,2);
  SET o_MoneyNum=in_MoneyNum;
/*结算类型0无1RMB2钻石3金币*/
  /*RMB*/
  IF in_MoneyType=1 THEN
     SELECT ua.rmb INTO v_rmb FROM user_account ua WHERE ua.userid=in_UserId;
     IF v_rmb<ABS(in_MoneyNum) AND in_MoneyNum<0 THEN
                            VALUES(in_UserId,'RM',in_fundtype,-v_rmb,SYSDATE(),in_setid,v_rmb);
        UPDATE user_account ua SET ua.rmb=0 WHERE ua.userid=in_UserId;
        SET o_MoneyNum=-v_rmb;
     ELSE
                            VALUES(in_UserId,'RM',in_fundtype,in_MoneyNum,SYSDATE(),in_setid,v_rmb);
        UPDATE user_account ua SET ua.rmb=ua.rmb+in_MoneyNum WHERE ua.userid=in_UserId;
        SET o_MoneyNum=in_MoneyNum;
     END IF;
    /*钻石*/
  ELSEIF in_MoneyType=2 THEN
    SELECT ua.diamond INTO v_diamond FROM user_account ua WHERE ua.userid=in_UserId;
     IF v_diamond<ABS(in_MoneyNum) AND in_MoneyNum<0 THEN
                            VALUES(in_UserId,'VD',in_fundtype,-v_diamond,SYSDATE(),in_setid,v_diamond);
        UPDATE user_account ua SET ua.diamond=0 WHERE ua.userid=in_UserId;
        SET o_MoneyNum=-v_diamond;
     ELSE
                            VALUES(in_UserId,'VD',in_fundtype,in_MoneyNum,SYSDATE(),in_setid,v_diamond);
        UPDATE user_account ua SET ua.diamond=ua.diamond+in_MoneyNum WHERE ua.userid=in_UserId;
        SET o_MoneyNum=in_MoneyNum;
     END IF;
  /*金币*/
  ELSEIF in_MoneyType=3 THEN
     SELECT ua.gold INTO v_gold FROM user_account ua WHERE ua.userid=in_UserId;
     IF v_gold<ABS(in_MoneyNum) AND in_MoneyNum<0 THEN
                            VALUES(in_UserId,'VG',in_fundtype,-v_gold,SYSDATE(),in_setid,v_gold);
        UPDATE user_account ua SET ua.gold=0 WHERE ua.userid=in_UserId;
        SET o_MoneyNum=-v_gold;
     ELSE
                            VALUES(in_UserId,'VG',in_fundtype,in_MoneyNum,SYSDATE(),in_setid,v_gold);
        UPDATE user_account ua SET ua.gold=ua.gold+in_MoneyNum WHERE ua.userid=in_UserId;
        SET o_MoneyNum=in_MoneyNum;
     END IF;
  /*七豆*/
  ELSEIF in_MoneyType=4 THEN
     SELECT ua.qidou INTO v_qidou FROM user_account ua WHERE ua.userid=in_UserId;
     IF v_qidou<ABS(in_MoneyNum) AND in_MoneyNum<0 THEN
                            VALUES(in_UserId,'VQ',in_fundtype,-v_qidou,SYSDATE(),in_setid,v_qidou);
        UPDATE user_account ua SET ua.qidou=0 WHERE ua.userid=in_UserId;
        SET o_MoneyNum=-v_qidou;
     ELSE
                            VALUES(in_UserId,'VQ',in_fundtype,in_MoneyNum,SYSDATE(),in_setid,v_qidou);
        UPDATE user_account ua SET ua.qidou=ua.qidou+in_MoneyNum WHERE ua.userid=in_UserId;
        SET o_MoneyNum=in_MoneyNum;
     END IF;
  END IF;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `GS_ThawUserAccount`
-- ----------------------------
DROP PROCEDURE IF EXISTS `GS_ThawUserAccount`;
DELIMITER ;;
CREATE DEFINER=`qiledb`@`%` PROCEDURE `GS_ThawUserAccount`(IN in_orderId varchar(50),
                                              IN in_moneyNum int,
                                              OUT returnvalue int)
lable:BEGIN
  DECLARE v_userid int;
  DECLARE v_rmb double(10,2);
  DECLARE v_diamond double(10,2);
  DECLARE v_gold double(10,2);
  DECLARE v_moneyType char(2);
  DECLARE v_freezenum int;
  /* 用户或亲友圈解冻记录
 输入：  in_orderId	varchar(50)	 冻结记录
         in_moneyNum	int	 表示实际需要扣除的数量
 输出: returnvalue 操作结果 1：解冻成功 -1：解冻失败*/
  SET @@autocommit=off;
  SET returnvalue=-1;
  /*获取用户*/
  SELECT lfuf.userid,lfuf.accounttype,lfuf.freezenum INTO v_userid,v_moneyType,v_freezenum 
   FROM log_funds_user_freeze lfuf WHERE lfuf.freezeid=in_orderId;
 /*账户解冻*/
    UPDATE log_funds_user_freeze lfuf
       SET lfuf.freezestatus='1',
           lfuf.unfreezetime=SYSDATE(),
           lfuf.realnum=in_moneyNum
      WHERE lfuf.freezeid=in_orderId;
    CALL sp_log_fund_user(in_orderId,v_userid,v_freezenum,v_moneyType,'27');
  SET returnvalue=1;
  COMMIT;
  --
   /* SELECT ua.rmb,ua.diamond,ua.gold INTO v_rmb,v_diamond,v_gold
     FROM user_account ua WHERE ua.userid=v_userid;*/
  /*扣款*/
  /*IF  v_moneyType= 'RM' THEN
       IF in_moneyNum<= v_rmb THEN
         CALL sp_log_fund_user(in_orderId,v_userid,-in_moneyNum,'RM','20');
         SET returnvalue=1;
         COMMIT;
        ELSE
          SET returnvalue=-1;
          ROLLBACK;
          LEAVE lable;
        END IF;
     ELSEIF v_moneyType= 'VD' THEN
       IF in_moneyNum<= v_diamond THEN
         CALL sp_log_fund_user(in_orderId,v_userid,-in_moneyNum,'VD','20');
         SET returnvalue=1;
         COMMIT;
        ELSE
          SET returnvalue=-1;
          ROLLBACK;
          LEAVE lable;
        END IF;
     ELSEIF v_moneyType= 'VG' THEN
       IF in_moneyNum<= v_gold THEN
         CALL sp_log_fund_user(in_orderId,v_userid,-in_moneyNum,'VG','20');
         SET returnvalue=1;
         COMMIT;
        ELSE
          SET returnvalue=-1;
          ROLLBACK;
          LEAVE lable;
        END IF;
   END IF;  */
                                           
  SELECT v_userid as UserId, 1 AS MoneyType ,ua.rmb AS MoneyNum ,ua.userid UserId FROM user_account ua WHERE ua.userid=v_userid
  UNION ALL
  SELECT v_userid as UserId, 2 AS MoneyType ,ua.diamond AS MoneyNum ,ua.userid UserId FROM user_account ua WHERE ua.userid=v_userid
  UNION ALL
  SELECT v_userid as UserId, 3 AS MoneyType ,ua.gold AS MoneyNum ,ua.userid UserId FROM user_account ua WHERE ua.userid=v_userid
  UNION ALL
  SELECT v_userid as UserId, 4 AS MoneyType ,ua.qidou AS MoneyNum ,ua.userid UserId FROM user_account ua WHERE ua.userid=v_userid;
END
;;
DELIMITER ;

