-- ----------------------------
-- Procedure structure for `sp_UserGiftRequest_update`
-- ----------------------------
DROP PROCEDURE IF EXISTS `sp_UserGiftRequest_update`;
DELIMITER ;;
CREATE DEFINER=`qiledb`@`%` PROCEDURE `sp_UserGiftRequest_update`(IN in_orderid varchar(50), 
                                                     IN in_remark varchar(255),
                                                     IN in_status char(1),
                                                     OUT returnvalue int)
BEGIN
DECLARE v_userid int;
DECLARE v_qidou  int;
  /* 玩家使用七豆兑换商品,更新
   输入：in_orderid 订单订单号
         in_remark  备注
         in_status 1成功 2处理中 0 失败
    输出：returnvalue  -1更新失败  1更新成功 */

  SET @@autocommit=off; 
  SET returnvalue = -1;
  IF in_status='0' THEN
    -- 退回已扣的七豆
     SELECT og.userid,og.qidou INTO v_userid,v_qidou FROM order_gift og WHERE og.orderid=in_orderid;
     CALL sp_log_fund_user(in_orderid,v_userid,v_qidou,'VQ','30');
		 SET returnvalue = 1;
  END IF;
     UPDATE order_gift og
       SET og.status=in_status,
           og.remark=in_remark,
           og.updatetime=SYSDATE()
      WHERE og.orderid=in_orderid;
			SET returnvalue = 1;
  COMMIT;
END
;;
