-- ----------------------------
-- Procedure structure for `WEB_GetGroupStat`
-- ----------------------------
DROP PROCEDURE IF EXISTS `WEB_GetGroupStat`;
DELIMITER ;;
CREATE DEFINER=`qiledb`@`%` PROCEDURE `WEB_GetGroupStat`(IN in_groupid int,IN in_userid int,out returnvalue int)
BEGIN
  /*亲友圈统计
    今日耗钻，昨日耗钻，近7天耗钻
    今日房间数，昨日房间数，近7天房间数
   in_groupid 统计的亲友圈
   in_userid  登陆用户，当前用户是管理员才有权限查看
   returnvalue -1 是错误，0无查看权限，1成功
    */
  SET returnvalue=-1;
-- //判断当前用户是否是管理员
   IF (SELECT COUNT(fu.id)  FROM friend_user fu WHERE fu.friendid=in_groupid AND fu.userid=in_userid AND fu.isadmin IN ('1','2'))=1 THEN
     -- //今日耗钻,今日房间数
      SELECT IFNULL(SUM(os.RoomCost*os.FeeUserCount),0) AS today_roomamt,IFNULL(COUNT(setid),0) AS today_roomcnt
        FROM order_settlement os
        WHERE os.groupid=in_groupid
      --  AND os.RoomCostType=2
          AND os.addtime>= str_to_date(DATE_FORMAT(SYSDATE(), '%Y-%m-%d'), '%Y-%m-%d');
     -- //昨日耗钻,昨日房间数
       SELECT IFNULL(SUM(fsd.roomamt),0) AS yesterday_roomamt,IFNULL(SUM(fsd.roomcnt),0) AS yesterday_roomcnt
        FROM friend_stat_day fsd
        WHERE fsd.friendid=in_groupid AND fsd.dateid=DATE_FORMAT(DATE_SUB(SYSDATE(), interval 1 DAY), '%Y-%m-%d');      
     -- //7日耗钻,7日房间数
       SELECT IFNULL(SUM(fsd.roomamt),0) AS day7_roomamt,IFNULL(SUM(fsd.roomcnt),0) AS day7_roomcnt
        FROM friend_stat_day fsd
        WHERE fsd.friendid=in_groupid AND fsd.dateid>=DATE_FORMAT(DATE_SUB(SYSDATE(), interval 7 DAY), '%Y-%m-%d'); 
       SET returnvalue=1;
   ELSE
     SET returnvalue=0;
   END IF;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `WEB_GetRankList`
-- ----------------------------
DROP PROCEDURE IF EXISTS `WEB_GetRankList`;
DELIMITER ;;
CREATE DEFINER=`qiledb`@`%` PROCEDURE `WEB_GetRankList`(in _userId int,in _count int, in rankType int, out returnvalue int)
BEGIN

   /*rankType 1 今日 2历史*/

/**
"userId",
"header",
"nickName",
"number",
"giveType",
"giveNum",
"rank",
*/ 
 DECLARE v_begintime datetime;
 DECLARE v_endtime datetime;
 DECLARE v_activityid varchar(50);

IF rankType=1 THEN
  SELECT userid,header,	nickname,number,	2 giveType,	( 55 - rank ) giveNum,	rank 
    FROM	(
	        SELECT  rank_data.userid,rank_data.header,rank_data.nickname,rank_data.totalamt AS number,
                	@rownum := @rownum + 1 AS rank
          	FROM
		            (	SELECT  aa.userid,ui.picfile header,ui.nickname,aa.totalamt 
		                FROM
                       (SELECT osd.userid,SUM(CASE WHEN os.gamenum>=os.totalnum AND os.gamenum>0 AND os.FeeUserCount>=4 THEN 1 ELSE 0 END) AS totalamt,max(osd.addtime) as addtime
                          FROM order_settlement os ,order_settlement_detail osd 
                         WHERE os.setid=osd.setid
                          and os.addtime>=str_to_date(SYSDATE(), '%Y-%m-%d')
                        GROUP BY osd.userid 
                        ) aa
		             	LEFT JOIN user_info ui ON aa.userid =ui.userid 
									ORDER BY aa.totalamt DESC,aa.addtime ASC,aa.userid
		            ) rank_data ,(SELECT @rownum := 0) rk
           ) rr 
    -- WHERE 1=2;
     WHERE rr.userid = _userId or rr.rank<=_count;

ELSEIF rankType=3 THEN
-- 是否有活动显示
   SELECT ua.activityid, ua.begintime,ua.endtime INTO v_activityid, v_begintime,v_endtime
      FROM user_activity ua 
     WHERE ua.status='1' 
      AND ua.activityid='20181001_1031TOP50TOTAL'
      AND ua.begintime<=SYSDATE()
      AND ua.endtime>=SYSDATE();

	 IF NOT ISNULL(v_activityid) THEN
     SELECT
	       userid,header,nickname,number,	2 giveType,	( 55 - rank ) giveNum,rank 
     FROM
	      ( SELECT rank_data.userid,rank_data.header,rank_data.nickname,rank_data.number,
                @rownum := @rownum + 1 AS rank
	          FROM 	
                (	SELECT rr.userid,ui.picfile header,ui.nickname,rr.number 
	                	FROM  (SELECT usd.userid,SUM(usd.totalamt) AS number,max(usd.lasttime) as tt
                             FROM user_stat_day usd
                            WHERE usd.dateid>=date_format(v_begintime, '%Y-%m-%d')
                              AND usd.dateid< date_format(DATE_ADD(v_endtime,interval 1 DAY), '%Y-%m-%d')
                            GROUP BY usd.userid
                            ) rr
			              LEFT JOIN user_info ui ON rr.userid =ui.userid 
                   ORDER BY rr.number DESC,rr.tt,rr.userid
		            ) rank_data ,(SELECT @rownum := 0) rk
         ) aa
     -- WHERE 1=2;
      WHERE aa.userid = _userId or aa.rank<=_count;


 ELSE
-- ------------------------------------------------
    SELECT
	       userid,header,nickname,number,	2 giveType,	( 55 - rank ) giveNum,rank 
     FROM
	      ( SELECT *,	 @rownum := @rownum + 1 AS rank
	          FROM 	
                (	SELECT r.userid,ui.picfile header,ui.nickname,r.number 
	                	FROM  (SELECT us.userid,SUM(us.roomcnt) AS number
                             FROM user_stat us
                            GROUP BY us.userid) r
			              LEFT JOIN user_info ui ON ui.userid = r.userid 
		                ORDER BY	number DESC ,ui.userid
		            ) rank_data ,(SELECT @rownum := 0) rk
         ) rr
    WHERE 1=1;
  END IF;

-- 七豆榜
 ELSEIF rankType=2 THEN

		SELECT userid,header,nickname,number,0 giveType,0 giveNum,rank
				FROM
						(
						SELECT
						aa.userid,
						aa.nickname,
						aa.qidou number,
						aa.header ,@ROW := @ROW + 1 AS rank
						FROM
								(
								SELECT
								ui.userid,
								ui.nickname,
								ua.qidou,
								ui.picfile header
								FROM
								user_info ui
								LEFT JOIN user_account ua ON ui.userid = ua.userid
								ORDER BY
								ua.qidou DESC
								) aa,
								(SELECT @ROW := 0) rk
					) rr
					WHERE rr.userid = _userId or rr.rank<=_count;

-- 雀神榜
 ELSEIF rankType=4 THEN

						select 
			rank,userid,number, 2 giveType,header,nickname,
			(case 
				when rank = 1 then 188 
				when rank = 2 then 128
				when rank = 3 then 88
				when rank > 3 and rank < 21 then 38
			 else 0
			 end
			) as giveNum
			from 
			(select aa.number,
			@row := @row + 1 as rank,
			aa.userid,
			(select ui.nickname from user_info ui where ui.userid = aa.userid ) nickname,
			(select ui.picfile from user_info ui where ui.userid = aa.userid ) header
			from
			(SELECT
			count(osd.setid) number,osd.userid
			from order_settlement_detail osd
			where osd.moneynum > 0 
			group by osd.userid
			order by number DESC) aa,
			(select @row:=0) rk) rr

		WHERE rr.userid = _userId or rr.rank<=_count; 

END IF;

set returnvalue = 1;


END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `WEB_GetUserReplayList`
-- ----------------------------
DROP PROCEDURE IF EXISTS `WEB_GetUserReplayList`;
DELIMITER ;;
CREATE DEFINER=`qiledb`@`%` PROCEDURE `WEB_GetUserReplayList`(IN _userId int, IN _startId int, IN _count int, OUT returnvalue int)
lable:BEGIN
-- DECLARE __now datetime DEFAULT now();  
set @startDate = DATE_SUB(now(),INTERVAL 15 DAY); 
-- select @startDate;

 drop table if EXISTS `tp_replay_group`;
 drop table if EXISTS `user_replaylist`;
 
  
 
  create TEMPORARY table user_replaylist
select 

rec.recordid,
rec.mid,
rec.sid,
rec.roomid,
rec.gameid,
rec.ownerid,
ui.picfile,
rule.rulestr,
rule.ruledesc,
rec.addtime,
rp.recpath

from order_recorddata rec 
	left join order_recorddata_detail rd on rec.recordid = rd.id 
	left join user_info ui on ui.userid = rec.ownerid
	left join friend_game rule on rule.id = rec.friendgameid
	left join order_recorddata_path rp on rec.recordid = rp.recordid
	where	(rd.userid = _userId) and rd.addtime > @startDate
  ;
	/*rec.ownerid = _userId or */

  create TEMPORARY table tp_replay_group 
	select ur.mid ,COUNT(*) from (select * from   user_replaylist  where (_startId = 0 or user_replaylist.recordid > _startId)) ur 
	group by ur.mid 
  ORDER BY 2 desc 
	limit _count;  


	select ur.* from user_replaylist ur right join tp_replay_group gp on ur.mid = gp.mid;
	SELECT 
	rd.* ,
	ui.nickname,
	ui.picfile
	from order_recorddata_detail rd
		left join user_info ui on ui.userid = rd.userid 
	where rd.recordid  in (select ur.recordid from user_replaylist ur right join tp_replay_group gp on ur.mid = gp.mid);


 set returnvalue =1;

END
;;
DELIMITER ;

