-- ----------------------------
-- Procedure structure for `WEB_GroupBan`
-- ----------------------------
DROP PROCEDURE IF EXISTS `WEB_GroupBan`;
DELIMITER ;;
CREATE DEFINER=`qiledb`@`%` PROCEDURE `WEB_GroupBan`(IN in_friendid int, 
                                        IN in_userid int, 
                                        IN in_friendgameid int,
                                        IN in_gameid int,
                                        IN in_bantype int,
                                        IN in_type char(1) ,
                                        OUT returnvalue int)
BEGIN

  /* 亲友圈玩家被禁查询，添加，解禁
   输入：in_friendid  亲友圈ID, 
         in_userid 玩家ID, 
         in_friendgameid 玩家场地ID,
         in_gameid 玩家游戏ID,
         in_bantype 被禁类型1被禁场地2被禁游戏3禁止所有游戏,
         in_type 操作类型 Q 查询 A 添加 D 解禁,
    输出：returnvalue  -1失败  1成功 */

  SET @@autocommit=off; 
  SET returnvalue = -1;
  IF in_type='A' THEN
    -- 添加
             VALUES(in_friendid,in_friendgameid,in_gameid,in_userid,SYSDATE(),in_bantype);
      SET returnvalue = 1;
      COMMIT;
  ELSEIF in_type='D' THEN
    -- 解禁
      IF in_bantype=1 THEN
                    VALUES(in_userid,'2',SYSDATE(),CONCAT('已被亲友圈:',in_friendid,'解除场地',in_friendgameid,'限制'));
         DELETE FROM friend_user_ban  WHERE friendid=in_friendid AND friendgameid=in_friendgameid AND userid=in_userid;
      ELSEIF in_bantype=2 THEN
                    VALUES(in_userid,'2',SYSDATE(),CONCAT('已被亲友圈:',in_friendid,'解除游戏',in_gameid,'限制'));
         DELETE FROM friend_user_ban  WHERE friendid=in_friendid AND gameid=in_gameid AND userid=in_userid;
      END IF;
      SET returnvalue = 1;
      COMMIT;        
  ELSEIF in_type='Q' THEN
    -- 查询 如果in_user=0 查询该亲友圈所有禁止用户
      IF in_userid=0 THEN
        SELECT fub.friendid,fub.friendgameid,fub.gameid,fub.userid,fub.bantype 
        FROM friend_user_ban fub 
        WHERE fub.friendid=in_friendid ;
      ELSE
        SELECT fub.friendid,fub.friendgameid,fub.gameid,fub.userid,fub.bantype 
        FROM friend_user_ban fub 
        WHERE fub.friendid=in_friendid 
         AND fub.userid=in_userid;
      END IF;
      SET returnvalue = 1;
  END IF;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `WEB_GroupGameOpen`
-- ----------------------------
DROP PROCEDURE IF EXISTS `WEB_GroupGameOpen`;
DELIMITER ;;
CREATE DEFINER=`qiledb`@`%` PROCEDURE `WEB_GroupGameOpen`(IN in_friendid int,
                                             IN in_friendgameid int,
                                             IN in_gameid int,
                                             IN in_userid int,
                                             IN in_type char(1),
                                             OUT returnvalue int)
la:BEGIN
  DECLARE v_friendid int;
  DECLARE v_gameid int;
  DECLARE v_id int;
  DECLARE in_friendgameid int DEFAULT 0;

  /* 亲友圈场地开始和暂停
   输入：in_friendid  亲友圈ID, 
         in_friendgameid 玩家场地ID,
         in_gameid 玩家游戏ID,
         in_userid 操作用户ID,
         in_type 操作类型 P 暂替 S 开始 Q 查询,
    输出：returnvalue  -1失败 0该场地不存在 1成功 */

  SET @@autocommit=off; 
  SET returnvalue = -1;
  IF not EXISTS(SELECT 1 from friend_user where friend_user.userid = in_userid and friend_user.friendid = in_friendid and friend_user.isadmin = '2' )
     THEN  
	   SET returnvalue = -1;
   	LEAVE  la;
  END IF;

  SELECT fg.friendid,fg.gameid
    INTO v_friendid,v_gameid
    FROM friend_game fg
    WHERE fg.friendid=in_friendid
     AND fg.gameid=in_gameid
     AND fg.status='1'
    LIMIT 1;
  IF NOT ISNULL(v_friendid) THEN
    IF in_type='S' THEN
      -- 开始
                   VALUES(v_friendid,in_friendgameid,v_gameid,SYSDATE(),SYSDATE(),'O');
         SET returnvalue = 1;
         COMMIT;
    ELSEIF in_type='P' THEN 
      -- 暂停 
         UPDATE friend_game_log
            SET endtime=SYSDATE()
               ,gamestatus='P'
          WHERE friendid=in_friendid
           AND gameid=in_gameid
           AND gamestatus='O';
          SET returnvalue = 1;
          COMMIT;
     ELSEIF in_type='Q' THEN
      -- 查询
         SELECT MAX(fgl.id) INTO v_id
           FROM friend_game_log fgl
          WHERE fgl.friendid=in_friendid
           AND fgl.gameid=in_gameid;

         SELECT fgl.friendid,fgl.gameid,fgl.begintime,fgl.endtime,fgl.gamestatus
           FROM friend_game_log fgl
          WHERE fgl.id =v_id;
         SET returnvalue = 1;
    END IF;
  ELSE
    SET returnvalue = 0;
  END IF;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `WEB_GroupGameStat`
-- ----------------------------
DROP PROCEDURE IF EXISTS `WEB_GroupGameStat`;
DELIMITER ;;
CREATE DEFINER=`qiledb`@`%` PROCEDURE `WEB_GroupGameStat`(IN in_friendid int,
                                             IN in_gameid int,
                                             IN in_userid int,
                                             IN in_begintime varchar(20), 
                                             IN in_endtime varchar(20),
                                             IN in_startId int,
                                             IN in_count int,
                                             OUT returnvalue int)
BEGIN
  DECLARE v_max_now datetime;
  DECLARE v_gameid int;
  DECLARE v_id int;
  DECLARE in_friendgameid int DEFAULT 0;

  /* 查询最近战绩，今日，昨日，前日
   输入：in_friendid  亲友圈ID, 
         in_gameid 玩家游戏ID,
         in_userid 操作用户ID,
         in_begintime 开始时间 格式： YYYY-mm-dd hh24
         in_endtime 结束时间 格式： YYYY-mm-dd hh24
    输出：returnvalue  -1失败  1成功 */

  SET returnvalue = -1;
	
	drop table if EXISTS `t_group_replaylist`;
		 
  IF in_userid>0 THEN
	
     CREATE TEMPORARY TABLE t_group_replaylist
            SELECT os.setid,os.gameid,osd.moneynum,os.addtime,os.tableid,os.gamenum,os.mid
              FROM order_settlement os,order_settlement_detail osd
             WHERE os.setid=osd.setid
               AND os.groupid=in_friendid
               AND os.gameid=in_gameid
               AND osd.userid=in_userid
               AND os.addtime>=str_to_date(in_begintime, '%Y-%m-%d %H')
               AND os.addtime<DATE_ADD(str_to_date(in_endtime, '%Y-%m-%d %H'),INTERVAL 1 HOUR)
               AND os.setid<in_startId
            ORDER BY os.addtime DESC
            LIMIT in_count;
    --
    SELECT  tgr.setid,tgr.gameid,tgr.moneynum,tgr.addtime,tgr.tableid,tgr.gamenum,tgr.mid,gi.gamename
     FROM t_group_replaylist tgr,game_info gi 
    WHERE tgr.gameid=gi.gameid;
    --
    SELECT os.setid,osd.userid,ui.nickname,ui.picfile,osd.moneynum,osd.iswiner
          FROM order_settlement os,order_settlement_detail osd,user_info ui
         WHERE os.setid=osd.setid
           AND osd.userid=ui.userid
           AND os.setid IN (SELECT setid FROM t_group_replaylist)
        ORDER BY os.setid DESC,osd.moneynum DESC;

   /* SELECT aa.mid,aa.userid,aa.nickname,aa.moneynum,
      IF(@m=aa.mid, CASE WHEN @n=aa.moneynum THEN @r ELSE @r:=@r+1 END,
      @r:=1  ) AS winuser,
       @m:=aa.mid,
       @n:=aa.moneynum
      FROM
       (SELECT os.mid,osd.userid,ui.nickname,osd.moneynum
          FROM order_settlement os,order_settlement_detail osd,user_info ui
         WHERE os.setid=osd.setid
           AND osd.userid=ui.userid
           AND os.mid IN (SELECT mid FROM t_group_replaylist)
        ORDER BY os.mid,osd.moneynum DESC) aa,(SELECT @m:=null,@n:=0,@r:=0) dd;*/

  ELSEIF in_userid=0 THEN
    SELECT osd.userid,ui.nickname,ui.picfile,COUNT(os.mid) AS cnt,SUM(osd.iswiner) AS userwin,
        SUM(IF(osd.moneynum>=0,1,0)) AS victory,SUM(IF(osd.moneynum>=0,0,1)) AS fail,SUM(osd.moneynum) AS moneynum
              FROM order_settlement os,order_settlement_detail osd,user_info ui
             WHERE os.setid=osd.setid
               AND osd.userid=ui.userid
               AND os.groupid=in_friendid
               AND os.gameid=in_gameid
               AND os.addtime>=str_to_date(in_begintime, '%Y-%m-%d %H')
               AND os.addtime<DATE_ADD(str_to_date(in_endtime, '%Y-%m-%d %H'),INTERVAL 1 HOUR)
  GROUP BY osd.userid,ui.nickname,ui.picfile
  ORDER BY 3 DESC,4 DESC;
  END IF;
  SET returnvalue = 1;
  
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `WEB_HallMsgList`
-- ----------------------------
DROP PROCEDURE IF EXISTS `WEB_HallMsgList`;
DELIMITER ;;
CREATE DEFINER=`qiledb`@`%` PROCEDURE `WEB_HallMsgList`(IN in_msgobject char(1), IN in_objectid int, OUT returnvalue int)
BEGIN
	#用户和代理获取消息
	/*
		in_msgobject  A代理U用户
	*	in_objectid 	userid或者agentid

	* returnvalue	  返回结果-1 失败 1成功
	*/
	SET returnvalue = -1;
  IF in_msgobject='A' THEN
               SELECT mc.id,in_objectid,SYSDATE(),mc.title,mc.content,'0'
                FROM msg_content mc
                WHERE mc.msgstatus='1'
                  AND mc.msgobject='A'
                  AND mc.begintime<=SYSDATE()
                  AND mc.endtime>=SYSDATE()
                  AND NOT EXISTS(SELECT mca.id FROM msg_content_agent mca WHERE mca.msgid=mc.id AND mca.agentid=in_objectid);
     COMMIT; 
     SELECT mca.id,mca.addtime,mca.title,mca.content,mca.status AS opstatus,mca.opentime AS optime
       FROM msg_content_agent mca 
      WHERE mca.agentid=in_objectid
        ORDER BY mca.addtime DESC;
  ELSEIF  in_msgobject='U' THEN
               SELECT mc.id,in_objectid,SYSDATE(),mc.title,mc.content,'0'
                FROM msg_content mc
                WHERE mc.msgstatus='1'
                  AND mc.msgobject='U'
                  AND mc.begintime<=SYSDATE()
                  AND mc.endtime>=SYSDATE()
                  AND NOT EXISTS(SELECT mcu.id FROM msg_content_user mcu WHERE mcu.msgid=mc.id AND mcu.userid=in_objectid);
    COMMIT;
    SELECT mcu.id,mcu.addtime,mcu.title,mcu.content,mcu.status AS opstatus,mcu.opentime AS optime
       FROM msg_content_user mcu 
      WHERE mcu.userid=in_objectid
        ORDER BY mcu.addtime DESC;
  END IF;
  SET returnvalue = 1;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `WEB_MobileLogin`
-- ----------------------------
DROP PROCEDURE IF EXISTS `WEB_MobileLogin`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `WEB_MobileLogin`(IN `in_tel` varchar(11),OUT `returnvalue` int)
BEGIN
	#Routine body goes here...
	DECLARE v_serverMaintain INT;
	DECLARE v_counts INT;
	DECLARE v_status INT;
	DECLARE v_usertype INT;
	DECLARE v_userid INT;
	SELECT sys_config.sysvalue INTO v_serverMaintain from sys_config where sys_config.syskey = 'GAME_ServerMaintain';
	SELECT usertype,userid INTO v_usertype,v_userid FROM user_info WHERE mobile = in_tel;
	IF v_serverMaintain = '0' OR v_usertype = '2' THEN
		SELECT COUNT(*) INTO v_counts FROM user_info WHERE mobile = in_tel;
		SELECT status INTO v_status FROM user_info WHERE mobile = in_tel;
		IF v_counts > 0 THEN
				IF v_counts > 1 THEN
					SET returnvalue = -4;
				ELSE 
							IF v_status <> '1' THEN
									SET returnvalue = -2;
							ELSE
									SELECT userid FROM user_info WHERE mobile = in_tel;
									SET returnvalue = 1;
									COMMIT;
							END IF;
				END IF;
		ELSE
			SET returnvalue = -3;
		END IF;
	ELSE
		SET returnvalue = -1;
	END IF;
END
;;
DELIMITER ;

