DROP PROCEDURE IF EXISTS `WEB_PyGroupList`;
DELIMITER ;;
CREATE DEFINER=`qiledb`@`%` PROCEDURE `WEB_PyGroupList`(IN _userid int, OUT returnvalue int)
BEGIN

SELECT
	fi.friendid AS id,
	fi.friendname AS `name`,
	fi.notice AS `notice`,
	fi.picpath AS `header`,
	fi.userid AS userid,
	fi.accessgame AS accessgame,
	(SELECT COUNT(1) from friend_user where friend_user.friendid = fi.friendid) as UserCount,
	500 as MaxUserCount
FROM
	friend_info fi
	INNER JOIN friend_user fu ON fu.friendid = fi.friendid 
WHERE
	fu.userid = _userid
	and fi.`status` = '1';
	
	
set returnvalue = 1;

END
;;
DELIMITER ;

