DELIMITER ;;
CREATE DEFINER=`qiledb`@`%` PROCEDURE `WEB_PyGroupSetAdmin`(IN _userid int, IN _aid int, IN _isadmin int, IN _friendid int, OUT returnvalue int)
la:BEGIN

set @isAdmin := '0';


if not EXISTS(SELECT 1 from friend_user where friend_user.userid = _userid and friend_user.friendid = _friendid and friend_user.isadmin = '2' )
then  
	set returnvalue = -1;
	leave la;
end if;

if(_aid = _userid) then 
 
	set returnvalue = -1;
leave la;
end if;

if( _isadmin = 1) then
	set @isAdmin := '1';
end if;

set @@autocommit = off;

update friend_user set friend_user.isadmin = @isAdmin where friend_user.userid = _aid and friend_user.friendid  = _friendid;

commit;

set returnvalue =1;

END
;;
DELIMITER ;

