-- ----------------------------
-- Procedure structure for `WEB_PyGroupUserExit`
-- ----------------------------
DROP PROCEDURE IF EXISTS `WEB_PyGroupUserExit`;
DELIMITER ;;
CREATE DEFINER=`qiledb`@`%` PROCEDURE `WEB_PyGroupUserExit`(IN _userid INT, IN _friendid INT, IN _exitid INT, OUT returnvalue INT)
la : BEGIN

SET @@autocommit = off;
IF
	( _userid <> _exitid ) THEN
IF
	( fc_isfriend_admin ( _userid, _friendid ) <= 0 ) THEN
-- 玩家是当前亲友圈的管理员，拒绝操作
	
	SET returnvalue = - 1;
LEAVE la;

END IF;

END IF;
IF
	NOT EXISTS ( SELECT 1 FROM friend_user WHERE friend_user.userid = _exitid AND friend_user.friendid = _friendid ) THEN
-- 玩家玩家不在当前的亲友圈，停止操作
		
		SET returnvalue = - 1;
	LEAVE la;
	
END IF;

-- 删除玩家信息
delete from friend_user where	friend_user.userid = _exitid 	AND friend_user.friendid = _friendid;

-- 插入玩家退出的日志信息
	
	set returnvalue = 1;
	commit;

END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `WEB_PyGroupUserJoin`
-- ----------------------------
DROP PROCEDURE IF EXISTS `WEB_PyGroupUserJoin`;
DELIMITER ;;
CREATE DEFINER=`qiledb`@`%` PROCEDURE `WEB_PyGroupUserJoin`(IN _userid int, IN _friendid int, OUT _errmsg VARCHAR(50), OUT returnvalue int)
la:BEGIN

set @@autocommit = off;
set _errmsg ='OK';
set returnvalue = -1;

if not exists (SELECT 1  from friend_info where friend_info.friendid = _friendid)
then 

-- 玩家已经成功加入了改亲友圈
set _errmsg ='亲友圈信息不存在';
set returnvalue = -1;
leave la;

end if;

if EXISTS(SELECT 1 from friend_user where friend_user.userid = _userid and friend_user.friendid = _friendid)
then
-- 玩家已经成功加入了该亲友圈
set _errmsg ='玩家已经加入指定的亲友圈';
set returnvalue = -1;
leave la;

end if;


-- 检查玩家是否已经提交了加入亲友圈的申请
if exists (SELECT 1 from log_friend_user where log_friend_user.userid = _userid and _friendid = log_friend_user.friendid and log_friend_user.`status` =0)
then 
-- 玩家已经提交了加入当前亲友圈的申请
set _errmsg = '玩家已经提交了加入当前亲友圈的申请';
set  returnvalue = -1;

leave la;

end if ;



											VALUES (NULL, _userid , _friendid , 0         , now()			, '0'			, NULL			, NULL		, '1'	);




commit;

set  returnvalue = 1;

END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `WEB_PyGroupUserList`
-- ----------------------------
DROP PROCEDURE IF EXISTS `WEB_PyGroupUserList`;
DELIMITER ;;
CREATE DEFINER=`qiledb`@`%` PROCEDURE `WEB_PyGroupUserList`(IN _userid int, 
		IN _friendid int, 
		IN _startid int, 
		IN _size int,
		in _hasAdmin int,
		OUT returnvalue int)
lable:BEGIN



IF not EXISTS ( SELECT 1 FROM friend_user WHERE friend_user.userid = _userid and friend_user.friendid = _friendid) THEN
	-- 玩家不是管理员，操作失败
	SET returnvalue = - 1;
	LEAVE lable;
END IF;

if(_hasAdmin >0 ) then 


SELECT
fu.id,
fu.userid,
ui.nickname as `name`,
ui.picfile as `header`,
fu.isadmin


from friend_user fu left join  user_info ui on fu.userid = ui.userid where fu.friendid = _friendid and fu.id < _startid 
order by fu.isadmin desc , fu.id DESC
LIMIT _size;

else


SELECT
fu.id,
fu.userid,
ui.nickname as `name`,
ui.picfile as `header`,
fu.isadmin


from friend_user fu left join  user_info ui on fu.userid = ui.userid where fu.friendid = _friendid and (fu.isadmin = 0 and fu.id < _startid ) 
order by fu.id DESC
LIMIT _size;

end if;



set returnvalue = 1;

END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `WEB_SetUserReadMsg`
-- ----------------------------
DROP PROCEDURE IF EXISTS `WEB_SetUserReadMsg`;
DELIMITER ;;
CREATE DEFINER=`qiledb`@`%` PROCEDURE `WEB_SetUserReadMsg`(IN in_msgobject char(1), IN in_objectid int, IN in_msgid int, OUT returnvalue int)
BEGIN
	#用户和代理查看消息后，消息已读
	/*
		in_msgobject  A代理U用户
	*	in_objectid 	userid或者agentid
    in_msgid      消息ID
	* returnvalue	  返回结果-1 失败 1成功
	*/
	SET returnvalue = -1;
	set @@autocommit =off;
	
  IF in_msgobject='U' THEN
     UPDATE msg_content_user mcu
        SET mcu.`status`='1',mcu.opentime=SYSDATE()
     WHERE mcu.id=in_msgid;
  ELSEIF  in_msgobject='A' THEN
     UPDATE msg_content_agent mca
        SET mca.`status`='1',mca.opentime=SYSDATE()
     WHERE mca.id=in_msgid;
	 
  END IF;
	
  COMMIT;
  SET returnvalue = 1;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `WEB_TaskGet`
-- ----------------------------
DROP PROCEDURE IF EXISTS `WEB_TaskGet`;
DELIMITER ;;
CREATE DEFINER=`qiledb`@`%` PROCEDURE `WEB_TaskGet`(IN in_userid int, 
                                       IN in_taskid varchar(50), 
                                      OUT returnvalue int)
BEGIN
  /* 任务领取
   输入：in_userid 玩家id
         in_taskid 任务id
   输出：returnvalue  -1失败 0 超过领取时间  1成功 */
  DECLARE v_tasktype char(1);
  DECLARE v_id int;
  DECLARE v_taskaward int;
  DECLARE v_awardtype char(2);
  DECLARE v_taskname varchar(100);
  DECLARE v_awardname varchar(20);
  DECLARE v_content varchar(200); 
  DECLARE v_title   varchar(50);
  SET @@autocommit=off; 
  SET returnvalue = -1;
  -- 判断当前任务是否存在
     SELECT tll.tasktype,tll.taskaward,tll.awardtype,tll.id,tl.taskname INTO v_tasktype,v_taskaward,v_awardtype,v_id,v_taskname
      FROM task_list_log tll ,task_list tl
      WHERE tll.taskid=tl.taskid
        AND tll.userid=in_userid 
        AND tll.taskid=in_taskid 
        AND tll.iscomplete='1'
        AND tll.isget='0'
        AND tll.lasttime>=SYSDATE();
  IF v_awardtype='VQ' THEN
     SET v_awardname='七豆';
  ELSEIF v_awardtype='VD' THEN
     SET v_awardname='钻石';
  END IF;

  IF NOT ISNULL(v_id) THEN
     SET v_title='任务奖励';
     SET v_content=CONCAT('恭喜您获得',v_taskname,'任务奖励：',v_taskaward,v_awardname,'，已存入你的账户，请查收。');
     CALL sp_log_fund_user(v_id,in_userid,v_taskaward,v_awardtype,'35');
		 CALL sp_get_user_moneybag(in_userid);
          /*推送信息*/
                  VALUES(-1,in_userid,SYSDATE(),v_content,v_title);
      UPDATE task_list_log tll
         SET tll.isget='1',
             tll.gettime=SYSDATE()
       WHERE tll.id=v_id;
        COMMIT;
      SET returnvalue = 1;
   ELSE
      SET returnvalue = 0;
   END IF;

END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `WEB_TaskPut`
-- ----------------------------
DROP PROCEDURE IF EXISTS `WEB_TaskPut`;
DELIMITER ;;
CREATE DEFINER=`qiledb`@`%` PROCEDURE `WEB_TaskPut`(IN in_userid int, 
                                       IN in_taskid varchar(255), 
                                       IN in_tasknum int,
                                      OUT returnvalue int)
BEGIN
  /* 需要客户端完成任务，推送完成的任务
   输入：in_userid 玩家id
         in_taskid 任务id
         in_tasknum 完成任务数，如登录一次就是1
   输出：returnvalue  -1失败  1成功 */
  DECLARE v_tasktype char(1);
  DECLARE v_cnt int;
  DECLARE v_taskaward int;
  DECLARE v_awardtype char(2);
  DECLARE v_taskcond int;
  DECLARE v_getlimit int;
  DECLARE v_iscomplete char(1);
  DECLARE v_realnum int;
  SET @@autocommit=on; 
  SET returnvalue = -1;	


  -- 查找任务信息
  SELECT tl.tasktype,tl.taskaward,tl.awardtype,tl.taskcond,tl.getlimit
     INTO v_tasktype,v_taskaward,v_awardtype,v_taskcond,v_getlimit
    FROM task_list tl 
    WHERE tl.taskid=in_taskid
     AND tl.status='1';
-- 日任务
  IF v_tasktype='D' THEN
      -- 判断当前任务是否存在
     SELECT tll.iscomplete,tll.realnum INTO v_iscomplete,v_realnum
      FROM task_list_log tll 
      WHERE tll.userid=in_userid AND tll.taskid=in_taskid AND tll.taskdate=DATE_FORMAT(SYSDATE(),"%Y-%m-%d") LOCK IN SHARE MODE;
     IF ISNULL(v_iscomplete) THEN
        IF in_tasknum>=v_taskcond THEN
                   VALUES(in_userid,DATE_FORMAT(SYSDATE(),"%Y-%m-%d"),in_taskid,str_to_date(DATE_FORMAT(SYSDATE(),"%Y-%m-%d"), '%Y-%m-%d'),
                       str_to_date(CONCAT(DATE_FORMAT(SYSDATE(),"%Y-%m-%d"),' 23:59:59'), '%Y-%m-%d %H:%i:%S'),
                        v_taskaward,v_awardtype,v_tasktype,v_taskcond,in_tasknum,
                       str_to_date(CONCAT(DATE_FORMAT(DATE_ADD(SYSDATE(),interval v_getlimit DAY),"%Y-%m-%d"),' 23:59:59'), '%Y-%m-%d %H:%i:%S'),
                       '1',SYSDATE());
        ELSE
                   VALUES(in_userid,DATE_FORMAT(SYSDATE(),"%Y-%m-%d"),in_taskid,str_to_date(DATE_FORMAT(SYSDATE(),"%Y-%m-%d"), '%Y-%m-%d'),
                       str_to_date(CONCAT(DATE_FORMAT(SYSDATE(),"%Y-%m-%d"),' 23:59:59'), '%Y-%m-%d %H:%i:%S'),
                        v_taskaward,v_awardtype,v_tasktype,v_taskcond,in_tasknum,
                       str_to_date(CONCAT(DATE_FORMAT(DATE_ADD(SYSDATE(),interval v_getlimit DAY),"%Y-%m-%d"),' 23:59:59'), '%Y-%m-%d %H:%i:%S'),
                       '0',SYSDATE());
        END IF;
     ELSEIF v_iscomplete='0' THEN
        IF in_tasknum+v_realnum>=v_taskcond THEN 
            UPDATE task_list_log tll
               SET tll.realnum=tll.realnum+in_tasknum,
                   tll.iscomplete='1',
                   tll.completetime=SYSDATE()
             WHERE tll.userid=in_userid AND tll.taskid=in_taskid AND tll.taskdate=DATE_FORMAT(SYSDATE(),"%Y-%m-%d");
         ELSE
            UPDATE task_list_log tll
               SET tll.realnum=tll.realnum+in_tasknum,
                   tll.completetime=SYSDATE()
             WHERE tll.userid=in_userid AND tll.taskid=in_taskid AND tll.taskdate=DATE_FORMAT(SYSDATE(),"%Y-%m-%d");
        END IF;
     END IF; 
    COMMIT;
   SET returnvalue = 1;
  END IF;

-- 周任务
  IF v_tasktype='W' THEN
      -- 判断当前任务是否存在
     SELECT tll.iscomplete,tll.realnum INTO v_iscomplete,v_realnum
      FROM task_list_log tll 
      WHERE tll.userid=in_userid AND tll.taskid=in_taskid 
        AND tll.taskdate>=DATE_FORMAT(subdate(sysdate(),date_format(sysdate(),'%w')-1),"%Y-%m-%d")
        AND tll.taskdate<=DATE_FORMAT(subdate(sysdate(),date_format(sysdate(),'%w')-7),"%Y-%m-%d");
     IF ISNULL(v_iscomplete) THEN
        IF in_tasknum>=v_taskcond THEN
                   VALUES(in_userid,DATE_FORMAT(SYSDATE(),"%Y-%m-%d"),in_taskid,str_to_date(DATE_FORMAT(subdate(sysdate(),date_format(sysdate(),'%w')-1),"%Y-%m-%d"), '%Y-%m-%d'),
                       str_to_date(CONCAT(DATE_FORMAT(subdate(sysdate(),date_format(sysdate(),'%w')-7),"%Y-%m-%d"),' 23:59:59'), '%Y-%m-%d %H:%i:%S'),
                        v_taskaward,v_awardtype,v_tasktype,v_taskcond,in_tasknum,
                       str_to_date(CONCAT(DATE_FORMAT(DATE_ADD(subdate(sysdate(),date_format(sysdate(),'%w')-7),interval v_getlimit DAY),"%Y-%m-%d"),' 23:59:59'), '%Y-%m-%d %H:%i:%S'),
                       '1',SYSDATE());
        ELSE
                   VALUES(in_userid,DATE_FORMAT(SYSDATE(),"%Y-%m-%d"),in_taskid,str_to_date(DATE_FORMAT(subdate(sysdate(),date_format(sysdate(),'%w')-1),"%Y-%m-%d"), '%Y-%m-%d'),
                       str_to_date(CONCAT(DATE_FORMAT(subdate(sysdate(),date_format(sysdate(),'%w')-7),"%Y-%m-%d"),' 23:59:59'), '%Y-%m-%d %H:%i:%S'),
                        v_taskaward,v_awardtype,v_tasktype,v_taskcond,in_tasknum,
                       str_to_date(CONCAT(DATE_FORMAT(DATE_ADD(subdate(sysdate(),date_format(sysdate(),'%w')-7),interval v_getlimit DAY),"%Y-%m-%d"),' 23:59:59'), '%Y-%m-%d %H:%i:%S'),
                       '0',SYSDATE());
        END IF;
     ELSEIF v_iscomplete='0' THEN
        IF in_tasknum+v_realnum>=v_taskcond THEN 
            UPDATE task_list_log tll
               SET tll.realnum=tll.realnum+in_tasknum,
                   tll.iscomplete='1',
                   tll.completetime=SYSDATE()
             WHERE tll.userid=in_userid AND tll.taskid=in_taskid 
               AND tll.taskdate>=DATE_FORMAT(subdate(sysdate(),date_format(sysdate(),'%w')-1),"%Y-%m-%d")
               AND tll.taskdate<=DATE_FORMAT(subdate(sysdate(),date_format(sysdate(),'%w')-7),"%Y-%m-%d");
         ELSE
            UPDATE task_list_log tll
               SET tll.realnum=tll.realnum+in_tasknum,
                   tll.completetime=SYSDATE()
             WHERE tll.userid=in_userid AND tll.taskid=in_taskid 
               AND tll.taskdate>=DATE_FORMAT(subdate(sysdate(),date_format(sysdate(),'%w')-1),"%Y-%m-%d")
               AND tll.taskdate<=DATE_FORMAT(subdate(sysdate(),date_format(sysdate(),'%w')-7),"%Y-%m-%d");
        END IF;
     END IF; 
    COMMIT;
   SET returnvalue = 1;
  END IF;

-- 月任务
  IF v_tasktype='M' THEN
      -- 判断当前任务是否存在
     SELECT tll.iscomplete,tll.realnum INTO v_iscomplete,v_realnum
      FROM task_list_log tll 
      WHERE tll.userid=in_userid AND tll.taskid=in_taskid 
        AND tll.taskdate>=DATE_FORMAT(DATE_ADD(SYSDATE(),interval -day(SYSDATE())+1 day),"%Y-%m-%d")
        AND tll.taskdate<=DATE_FORMAT(last_day(sysdate()),"%Y-%m-%d");
     IF ISNULL(v_iscomplete) THEN
        IF in_tasknum>=v_taskcond THEN
                   VALUES(in_userid,DATE_FORMAT(SYSDATE(),"%Y-%m-%d"),in_taskid,str_to_date(DATE_FORMAT(DATE_ADD(SYSDATE(),interval -day(SYSDATE())+1 day),"%Y-%m-%d"), '%Y-%m-%d'),
                       str_to_date(CONCAT(DATE_FORMAT(last_day(sysdate()),"%Y-%m-%d"),' 23:59:59'), '%Y-%m-%d %H:%i:%S'),
                        v_taskaward,v_awardtype,v_tasktype,v_taskcond,in_tasknum,
                       str_to_date(CONCAT(DATE_FORMAT(DATE_ADD(last_day(sysdate()),interval v_getlimit DAY),"%Y-%m-%d"),' 23:59:59'), '%Y-%m-%d %H:%i:%S'),
                       '1',SYSDATE());
        ELSE
                   VALUES(in_userid,DATE_FORMAT(SYSDATE(),"%Y-%m-%d"),in_taskid,str_to_date(DATE_FORMAT(DATE_ADD(SYSDATE(),interval -day(SYSDATE())+1 day),"%Y-%m-%d"), '%Y-%m-%d'),
                       str_to_date(CONCAT(DATE_FORMAT(last_day(sysdate()),"%Y-%m-%d"),' 23:59:59'), '%Y-%m-%d %H:%i:%S'),
                        v_taskaward,v_awardtype,v_tasktype,v_taskcond,in_tasknum,
                       str_to_date(CONCAT(DATE_FORMAT(DATE_ADD(last_day(sysdate()),interval v_getlimit DAY),"%Y-%m-%d"),' 23:59:59'), '%Y-%m-%d %H:%i:%S'),
                       '0',SYSDATE());
        END IF;
     ELSEIF v_iscomplete='0' THEN
        IF in_tasknum+v_realnum>=v_taskcond THEN 
            UPDATE task_list_log tll
               SET tll.realnum=tll.realnum+in_tasknum,
                   tll.iscomplete='1',
                   tll.completetime=SYSDATE()
             WHERE tll.userid=in_userid AND tll.taskid=in_taskid 
               AND tll.taskdate>=DATE_FORMAT(DATE_ADD(SYSDATE(),interval -day(SYSDATE())+1 day),"%Y-%m-%d")
               AND tll.taskdate<=DATE_FORMAT(last_day(sysdate()),"%Y-%m-%d");
         ELSE
            UPDATE task_list_log tll
               SET tll.realnum=tll.realnum+in_tasknum,
                   tll.completetime=SYSDATE()
             WHERE tll.userid=in_userid AND tll.taskid=in_taskid 
               AND tll.taskdate>=DATE_FORMAT(DATE_ADD(SYSDATE(),interval -day(SYSDATE())+1 day),"%Y-%m-%d")
               AND tll.taskdate<=DATE_FORMAT(last_day(sysdate()),"%Y-%m-%d");
        END IF;
     END IF; 
   COMMIT;
   SET returnvalue = 1;
  END IF;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `WEB_TaskQuery`
-- ----------------------------
DROP PROCEDURE IF EXISTS `WEB_TaskQuery`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `WEB_TaskQuery`(IN `in_userid` int,IN `_count` int,OUT `returnvalue` int)
BEGIN
	#Routine body goes here...
		SELECT 
				tl.taskid,
				tl.taskname,
				tl.taskaward,
				tl.awardtype,
				tl.tasktype,
				tl.addtime,
				tl.taskremark,
				tl.status,
				tl.taskcond,
				tl.getlimit,
				IFNULL(tll.isget,0) isget,
				IFNULL(tll.realnum,0) realnum,
				IFNULL(tll.iscomplete,0) iscomplete,
				tl.target,
				tl.next,
				fc_split_str(tl.taskid,'_',4) cn,
        (CASE WHEN tll.iscomplete = '1' THEN (case when tll.isget='0' THEN 1 ELSE 9 END) ELSE 2 END) as orderby
		FROM 
			task_list tl	LEFT JOIN task_list_log tll ON tl.taskid = tll.taskid AND tll.userid = in_userid
		WHERE tl.`status` = '1'
		ORDER BY 15,tl.taskaward 
		LIMIT _count;
		SET returnvalue = 1;

END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `WEB_TaskUpload`
-- ----------------------------
DROP PROCEDURE IF EXISTS `WEB_TaskUpload`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `WEB_TaskUpload`(IN `in_userid` int,IN `in_task` varchar(255),IN `in_tasknum` int,OUT `returnvalue` int)
BEGIN
	#Routine body goes here...
	/*
		备注:循环任务严格按照优先级和命名方式

		命名方式: 标记_名称_类型_次序
		U:单一任务  R:循环任务 单一任务次序一律为0 循环任务 1,2,3...
		命名举例 单一任务:每日登录: C_Charge_U_0
						 循环任务:麻将大赢家 S_BigWinMahjong_R_1 S_BigWinMahjong_R_2 S_BigWinMahjong_R_3
		调用方式: CALL WEB_TaskUpload(210110,'S_BigWinMahjong_R_1|S_BigWinMahjong_R_2|S_BigWinMahjong_R_3',1,@p_out);这里观察次序递增
		in_userid 玩家ID
		in_task   玩家任务集合以|分隔
		in_tasknum任务数
	*/
		DECLARE v_i INT DEFAULT 0;
		DECLARE in_taskid VARCHAR(20);
	  DECLARE v_rcnt INT DEFAULT 0;
		SET returnvalue = -1;
		SET @@autocommit=on;
	 	loop_label:LOOP
			SET v_i = v_i + 1;
			SET in_taskid = fc_split_str(in_task,'|',v_i);
		  
			IF ISNULL(in_taskid) THEN
 				LEAVE loop_label;		
			END IF;
		/* 如果当前ID任务未领取状态则进行,否则结束 */
    IF (SELECT COUNT(*)  FROM task_list_log WHERE taskid = in_taskid AND isget = 1 and userid=in_userid)=0 THEN
			 /* 如果是单一任务则进行如下操作 */
			 IF fc_split_str(in_taskid,'_',3)='U' THEN																												
		     CALL WEB_TaskPut(in_userid,in_taskid,in_tasknum,@p_out);
			 /* 如果是循环任务则进行以下操作 */
       ELSEIF fc_split_str(in_taskid,'_',3)='R' THEN	
          IF v_rcnt=0 THEN
            SET v_rcnt=fc_split_str(in_taskid,'_',4)+0 ;
          END IF;
          IF fc_split_str(in_taskid,'_',4)+0=v_rcnt THEN
            CALL WEB_TaskPut(in_userid,in_taskid,in_tasknum,@p_out);
          END IF;
       END IF;
    END IF;
		END LOOP;
		SET returnvalue = 1;
		COMMIT;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `WEB_UserBindTel`
-- ----------------------------
DROP PROCEDURE IF EXISTS `WEB_UserBindTel`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `WEB_UserBindTel`(IN `in_userid` int,IN `in_tel` varchar(15),OUT `returnvalue` int)
BEGIN
	DECLARE v_qidou int;
	IF (SELECT count(userid) FROM user_info WHERE userid = in_userid ) > 0 THEN
		IF (SELECT COUNT(mobile) FROM user_info WHERE mobile = in_tel ) = 0 THEN
			SELECT qidou INTO v_qidou FROM user_account WHERE userid = in_userid;
			UPDATE user_info SET mobile = in_tel WHERE userid = in_userid;
			UPDATE user_account SET qidou = v_qidou + 5 WHERE userid = in_userid;
			SET returnvalue = 1;
			COMMIT;
			CALL sp_get_user_moneybag(in_userid);
		ELSE
			SET returnvalue = -1;
		END IF;
	ELSE 
		SET returnvalue = 0;
  END IF;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `WEB_UserCompExit`
-- ----------------------------
DROP PROCEDURE IF EXISTS `WEB_UserCompExit`;
DELIMITER ;;
CREATE DEFINER=`qiledb`@`%` PROCEDURE `WEB_UserCompExit`(IN in_userid int, 
                                            IN in_compid varchar(50), 
                                           OUT returnvalue int)
BEGIN
DECLARE v_id int DEFAULT 0;
DECLARE v_groupid int;
DECLARE v_compjoin int;
DECLARE v_ownerid int;
DECLARE v_compbegin datetime;

  /* 玩家退出亲友圈比赛
   输入：in_userid 玩家id
         in_compid 比赛id
   输出：returnvalue  -1退出失败 0已经开赛无法退出 1退出成功 2玩家没有加入此比赛 */

  SET @@autocommit=off; 
  SET returnvalue = -1;
  SELECT cu.id INTO v_id FROM competition_user cu WHERE cu.compid=in_compid AND cu.userid=in_userid;
  IF v_id>0 THEN
     SELECT ci.groupid,ci.compjoin,ci.ownerid,ci.compbegin
       INTO v_groupid,v_compjoin,v_ownerid,v_compbegin
       FROM competition_info ci 
      WHERE ci.compid=in_compid AND ci.compstatus=1;
  IF SYSDATE <= v_compbegin THEN
     DELETE FROM competition_user  WHERE id=v_id;
     IF v_groupid>0 THEN
         IF v_compjoin>0  THEN
             -- 退回报名费
            CALL sp_log_fund_user(in_compid,in_userid,v_compjoin,'VD','32');
            CALL sp_log_fund_user(in_compid,v_ownerid,-v_compjoin,'VD','33');
         END IF;
     ELSEIF v_groupid=0 THEN
         IF v_compjoin>0  THEN
             -- 退回报名费
            CALL sp_log_fund_user(in_compid,in_userid,v_compjoin,'VD','32');
         END IF;
     END IF;
     COMMIT;
     SET returnvalue = 1;
  ELSE
    SET returnvalue = 0;
  END IF;
  ELSE
    SET returnvalue = 2;
  END IF;
  
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `WEB_UserCompJoin`
-- ----------------------------
DROP PROCEDURE IF EXISTS `WEB_UserCompJoin`;
DELIMITER ;;
CREATE DEFINER=`qiledb`@`%` PROCEDURE `WEB_UserCompJoin`(IN in_userid int, 
                                        IN in_compid varchar(50), 
                                        OUT returnvalue int)
BEGIN
DECLARE v_id int;
DECLARE v_cnt int DEFAULT 0;
DECLARE v_groupid int;
DECLARE v_compjoin int;
DECLARE v_comptype int;
DECLARE v_ownerid int;

  /* 玩家加入亲友圈比赛
   输入：in_userid 玩家id
         in_compid 比赛id
   输出：returnvalue  -1加入失败 0玩家不在此亲友圈 1加入成功 2 玩家已经加入比赛  */

  SET @@autocommit=off; 
  SET returnvalue = -1;
  IF (SELECT COUNT(*) FROM competition_user cu WHERE cu.compid=in_compid AND cu.userid=in_userid)=0 THEN
  SELECT ci.groupid,ci.compjoin,ci.comptype,ci.ownerid
   INTO v_groupid,v_compjoin,v_comptype,v_ownerid
    FROM competition_info ci 
   WHERE ci.compid=in_compid AND ci.compstatus=1;
  IF v_groupid>0 THEN
     -- 判断玩家是否在此亲友圈
     SELECT COUNT(*) INTO v_cnt FROM friend_user fu WHERE fu.friendid=v_groupid AND fu.userid=in_userid;
  ELSEIF v_groupid=0 THEN 
     -- 大厅游戏直接参与
     SET v_cnt=1;
  END IF;
  --
  IF v_cnt=1 THEN
     -- SELECT fc_nextval('competition_user') INTO v_id;
                          VALUES(in_compid,v_groupid,in_userid,SYSDATE(),v_compjoin,0,0,0,0,v_comptype,0);
     IF v_groupid>0 THEN
         IF v_compjoin>0  THEN
             -- 扣除报名费
            CALL sp_log_fund_user(in_compid,in_userid,-v_compjoin,'VD','31');
            CALL sp_log_fund_user(in_compid,v_ownerid,v_compjoin,'VD','33');
         END IF;
     ELSEIF v_groupid=0 THEN
         IF v_compjoin>0  THEN
             -- 扣除报名费
            CALL sp_log_fund_user(in_compid,in_userid,-v_compjoin,'VD','31');
         END IF;
     END IF;
     COMMIT;
     SET returnvalue = 1;
   ELSE
     SET returnvalue = 0;
   END IF;  
  ELSE
     SET returnvalue = 2;
  END IF;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `WEB_UserGiftRequest`
-- ----------------------------
DROP PROCEDURE IF EXISTS `WEB_UserGiftRequest`;
DELIMITER ;;
CREATE DEFINER=`qiledb`@`%` PROCEDURE `WEB_UserGiftRequest`(IN in_userid int, 
                                               IN in_giftid int, 
                                               IN in_name varchar(50),
                                               IN in_tel  varchar(20),
                                               IN in_address varchar(200),
                                               IN in_payaccount varchar(50),
                                               OUT returnvalue int)
BEGIN
DECLARE v_qidou DOUBLE(10,2);
DECLARE in_qidou DOUBLE(10,2);
DECLARE v_id varchar(50);
DECLARE v_gifttype int;


  /* 玩家使用七豆兑换商品
   输入：in_userid 玩家id
         in_giftid 商品id
         in_qidou 对换需要的七豆
    输出：returnvalue  -1下单失败 0余额不足 1下单成功 */

  SET @@autocommit=off; 
  SET returnvalue = -1;
  -- 判断账户余额
  SELECT gi.gifttype,gi.qidou INTO v_gifttype ,in_qidou FROM gift_info gi WHERE gi.id=in_giftid;
  SELECT ua.qidou INTO v_qidou FROM user_account ua WHERE ua.userid=in_userid;
     IF v_qidou>=in_qidou THEN
       SELECT CONCAT( DATE_FORMAT(SYSDATE(),'%m%d'),fc_nextval('order_gift')) INTO v_id;
       -- 插入订单
                      VALUES(v_id,in_giftid,in_userid,v_gifttype,'2',in_qidou,in_name,in_tel,in_address,in_payaccount,SYSDATE());
       -- 扣资金
       CALL sp_log_fund_user(v_id,in_userid,-in_qidou,'VQ','29');
			 -- #SELECT ua.rmb,ua.diamond,ua.gold,ua.qidou,ua.grift FROM user_account ua WHERE ua.userid = in_userid;
       SET returnvalue = 1; 
       COMMIT;
       call sp_get_user_moneybag(in_userid);
     ELSE
       SET returnvalue = 0;    
     END IF;
  
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `WEB_UserPayRequest`
-- ----------------------------
DROP PROCEDURE IF EXISTS `WEB_UserPayRequest`;
DELIMITER ;;
CREATE DEFINER=`qiledb`@`%` PROCEDURE `WEB_UserPayRequest`(IN in_userid int, IN _shopId int, IN in_outNo varchar(50), OUT _rmb DOUBLE(10, 2), OUT returnvalue int)
lable:BEGIN

DECLARE in_rmb DOUBLE(10,2);
DECLARE in_vcoin int;
DECLARE in_gift int; 
DECLARE in_accounttype int;
DECLARE in_gifttype int;
DECLARE v_gifttype char(2); 


SELECT rmb,moneytype,moneynum,givetype,givenum into 
			in_rmb,	in_accounttype,in_vcoin,in_gifttype,in_gift
from sys_shop where id = _shopId;

set _rmb = in_rmb;

IF (FOUND_ROWS() < 1) THEN
	-- 玩家不存在
SET returnvalue = -1;

LEAVE lable;
end if;

       /*Unknown = 0,
        RMB = 1,
        Diamond = 2,
        Gold = 3,
        QiDou = 4,
        MatchScore = 10*/


  /* 玩家充值下单
   输入：in_userid 玩家id
         in_rmb  支付金额
         in_vcoin 钻石数量
         in_gift 送数量
         in_accounttype 充值账户类型VD 钻石 VG金币 VQ 七乐币
         in_gifttype 送账户类型VD 钻石 VG金币 VQ 七乐币
    输出：o_out  订单号 ‘ ‘ 下单失败 */
		
  SET @@autocommit=off; 
  IF in_accounttype=2 THEN
      SELECT CASE in_gifttype WHEN 2 THEN 'VD' WHEN 3 THEN 'VG' WHEN 4 THEN 'VQ' ELSE in_gifttype END INTO v_gifttype;
                VALUES(in_outNo,in_userid,'VD',in_rmb,in_vcoin,in_gift,now(),'U','0',v_gifttype);
  END IF;
  commit;
	set returnvalue = 1;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `WEB_UserPayResult`
-- ----------------------------
DROP PROCEDURE IF EXISTS `WEB_UserPayResult`;
DELIMITER ;;
CREATE DEFINER=`qiledb`@`%` PROCEDURE `WEB_UserPayResult`(IN in_orderid varchar(50), IN in_status char(1), IN in_realrmb DOUBLE(10, 2), IN in_paytype char(1), IN in_remark varchar(100), IN in_returnflage char(1), OUT returnvalue int)
BEGIN
  /* 用户充值
   输入：in_orderid 订单号
         in_realrmb 实际付款金额  
         in_status 1成功 2失败
         in_remark 微信订单号
         in_paytype 0线下支付1微信支付2支付宝
         in_returnflag 0不返佣 1返佣
    输出：returnvalue  -1充值失败 0 无订单号 1成功 */
  DECLARE v_auid int DEFAULT NULL;
  DECLARE v_vcoin int; 
  DECLARE v_accounttype char(2);
  DECLARE v_gifttype char(2);
  DECLARE v_gift double(12,2);
  set @@autocommit=off;
  SET returnvalue=-1;
  select op.auid,op.vcoin,op.accounttype,op.gifttype,op.gift into v_auid,v_vcoin,v_accounttype,v_gifttype,v_gift
   from order_pay op where op.id=in_orderid and op.status='0' and op.userflag='U';
  /* 充钻 */
  IF NOT ISNULL(v_auid) AND v_accounttype='VD' THEN
    IF  in_status='1' THEN
    /* 充送 */
      CALL sp_user_pay_vd(in_orderid,v_auid,v_vcoin,v_gift,v_gifttype);
    /* 返佣 */
      IF in_returnflage='1' THEN
        CALL sp_user_pay_return(in_orderid,v_auid,in_realrmb);
      END IF;
    END IF;
    /* 更新订单记录 */
      update order_pay
         set status=in_status,paytime=now(),realrmb=in_realrmb,remark=in_remark,paytype=in_paytype
         where id=in_orderid;
      commit;
      set returnvalue=1;
			
			
--     SELECT 1 AS MoneyType ,ua.rmb AS MoneyNum ,ua.userid UserId FROM user_account ua   WHERE ua.userid=v_auid
--       UNION ALL
    SELECT 2 AS MoneyType ,ua.diamond AS MoneyNum ,ua.userid UserId FROM user_account ua WHERE ua.userid=v_auid
     UNION ALL
--     SELECT 3 AS MoneyType ,ua.gold AS MoneyNum,ua.userid UserId FROM user_account ua   WHERE ua.userid=v_auid
--      UNION ALL
    SELECT 4 AS MoneyType ,ua.qidou AS MoneyNum,ua.userid UserId FROM user_account ua   WHERE ua.userid=v_auid;

  ELSE
   set returnvalue=0;
  END if;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `WEB_UserSharedResult`
-- ----------------------------
DROP PROCEDURE IF EXISTS `WEB_UserSharedResult`;
DELIMITER ;;
CREATE DEFINER=`qiledb`@`%` PROCEDURE `WEB_UserSharedResult`(IN in_taskid varchar(50), IN in_user int, IN in_remark varchar(200), OUT returnvalue int)
BEGIN
  /* 用户分享结果返回
   输入：in_taskid 任务ID
         in_user 用户  
         in_remark 备注，可填写分享用户ID
   输出：returnvalue  -1失败 0已经分享  1分享成功 */
  DECLARE v_diamond double(12,2);
  DECLARE v_gold double(12,2);
  DECLARE v_qidou double(12,2);
  DECLARE v_cnt int;
  DECLARE v_logid varchar(20);
  SET @@autocommit=off;
  SET returnvalue=-1;
    /*判断今天是否已经分享*/
    SELECT COUNT(utl.logid) INTO v_cnt
      FROM user_task_log utl 
     WHERE utl.addtime>=str_to_date(SYSDATE(), '%Y-%m-%d') AND utl.userid=in_user and utl.taskid = in_taskid;
    IF v_cnt<=0 THEN
       /*获取任务信息 */
       SELECT ut.diamond,ut.gold,ut.qidou INTO v_diamond,v_gold,v_qidou
         FROM user_task ut 
        WHERE ut.taskid=in_taskid;
      /*  */
        SELECT CONCAT( DATE_FORMAT(now(),'%y%m%d') ,fc_nextval('user_task_log')) INTO v_logid;
             VALUES(v_logid,in_taskid,in_user,SYSDATE(),in_remark,v_diamond,v_gold,v_qidou);
        IF v_diamond>0 THEN
           CALL sp_log_fund_user(v_logid,in_user,v_diamond,'VD','25');
        END IF;
        IF v_gold>0 THEN
           CALL sp_log_fund_user(v_logid,in_user,v_gold,'VG','25');
        END IF;
        IF v_qidou>0 THEN
           CALL sp_log_fund_user(v_logid,in_user,v_diamond,'VQ','25');
        END IF;
				
			call sp_get_user_moneybag(in_user);
			SELECT 	v_diamond as diamond,
							v_gold as gold,
							v_qidou as qidou;
			
			SET returnvalue=1;

			CALL WEB_TaskPut(in_user,'C_Share_U_0',1,@p_out);

     ELSE
       SET returnvalue=0;
     END IF;
	 COMMIT;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `WEB_UserVerified`
-- ----------------------------
DROP PROCEDURE IF EXISTS `WEB_UserVerified`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `WEB_UserVerified`(IN `in_userid` int,IN `in_realname` varchar(30),IN `in_idcard` varchar(20),OUT `returnvalue` int)
BEGIN
	#Routine body goes here...
	DECLARE v_qidou INT;
	IF( SELECT COUNT(*) FROM user_info WHERE userid = in_userid ) > 0 THEN
		IF(SELECT COUNT(*) FROM user_info WHERE idcard = in_idcard ) > 0 THEN
		SET returnvalue = -1;
		ELSE
			SELECT qidou INTO v_qidou FROM user_account WHERE userid = in_userid;
			UPDATE user_info SET isname = '1', realname = in_realname, idcard = in_idcard WHERE userid = in_userid;
			UPDATE user_account SET qidou = v_qidou + 5 WHERE userid = in_userid;
			SET returnvalue = 1;
			COMMIT;
			CALL sp_get_user_moneybag(in_userid);
		END IF;
	ELSE
		SET returnvalue = 0;
	END IF;
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for `fc_currval`
