    READS SQL DATA
    DETERMINISTIC
BEGIN  
DECLARE v_VALUE int;  
SELECT current_value INTO v_VALUE FROM sys_sequence WHERE NAME = seq_name;  
RETURN v_VALUE;  
END
;;
