-- ----------------------------
-- Function structure for `fc_get_sysconfig`
-- ----------------------------
DROP FUNCTION IF EXISTS `fc_get_sysconfig`;
DELIMITER ;;
CREATE DEFINER=`qiledb`@`%` FUNCTION `fc_get_sysconfig`(in_syskey varchar(20)) RETURNS varchar(50) CHARSET utf8mb4
    READS SQL DATA
    DETERMINISTIC
BEGIN
  DECLARE v_sysvalue varchar(50);
