-- ----------------------------
-- Function structure for `fc_istest_user`
-- ----------------------------
DROP FUNCTION IF EXISTS `fc_istest_user`;
DELIMITER ;;
CREATE DEFINER=`qiledb`@`%` FUNCTION `fc_istest_user`(`_userid` int) RETURNS int(11)
BEGIN

DECLARE __val int DEFAULT -1;


SELECT user_info.usertype into __val from user_info where user_info.userid = _userid limit 1;

return __val;

END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for `fc_nextval`
-- ----------------------------
DROP FUNCTION IF EXISTS `fc_nextval`;
DELIMITER ;;
CREATE DEFINER=`qiledb`@`%` FUNCTION `fc_nextval`(seq_name VARCHAR(20)) RETURNS int(11)
    DETERMINISTIC
BEGIN  
  
UPDATE sys_sequence SET current_value = current_value + increment WHERE NAME = seq_name;  
RETURN fc_currval(seq_name);  
  
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for `fc_order_str`
-- ----------------------------
DROP FUNCTION IF EXISTS `fc_order_str`;
DELIMITER ;;
CREATE DEFINER=`qiledb`@`%` FUNCTION `fc_order_str`(in_str varchar(500)) RETURNS varchar(500) CHARSET utf8mb4
    DETERMINISTIC
BEGIN
  DECLARE v_str varchar(500) DEFAULT NULL;
  DECLARE v_i int;
  DECLARE v_max_moneynum int DEFAULT 0;
  DECLARE v_in_moneynum int DEFAULT 0;
  SET v_i=0;
  loop_label:loop
      SET v_i=v_i+1;
      SET v_in_moneynum=fc_split_str(in_str,';',v_i)+0;
      IF ISNULL(v_in_moneynum) THEN
           leave loop_label;
      END IF;
      IF v_i=1 THEN
         IF v_in_moneynum>0 THEN
          SET v_max_moneynum=v_in_moneynum;
            SET v_str='1';
            ELSE
            SET v_str='0';
         END IF;
      ELSE
         IF v_in_moneynum>0  THEN
              IF v_max_moneynum<v_in_moneynum THEN
                  SET v_str=CONCAT(REPLACE(v_str,'1','0'),';','1');
                  SET v_max_moneynum=v_in_moneynum;
              ELSEIF v_max_moneynum=v_in_moneynum THEN
                  SET v_str=CONCAT(v_str,';','1');
              ELSE
                  SET v_str=CONCAT(v_str,';','0');
              END IF;
          ELSE 
              SET v_str=CONCAT(v_str,';','0');
          END IF;
        END IF;          
  end loop;
  RETURN v_str;
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for `fc_split_str`
-- ----------------------------
DROP FUNCTION IF EXISTS `fc_split_str`;
DELIMITER ;;
CREATE DEFINER=`qiledb`@`%` FUNCTION `fc_split_str`(in_str varchar(500), in_split varchar(5), in_postion int) RETURNS varchar(30) CHARSET utf8mb4
    DETERMINISTIC
BEGIN
  DECLARE v_str varchar(255) DEFAULT NULL;
  IF LENGTH(SUBSTRING_INDEX(in_str, in_split, in_postion))<LENGTH(in_str) 
    OR (LENGTH(SUBSTRING_INDEX(in_str, in_split, in_postion))=LENGTH(in_str) AND LENGTH(SUBSTRING_INDEX(in_str, in_split, in_postion-1))<LENGTH(in_str) )THEN
    SELECT
      SUBSTRING_INDEX(SUBSTRING_INDEX(in_str, in_split, in_postion), in_split, -1) INTO v_str;
  END IF;
  IF v_str='' THEN 
    SET v_str=NULL;
  END IF;
  RETURN v_str;
END
;;
DELIMITER ;
